class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $limit
     * @return Integer[]
     */
    function lexicographicallySmallestArray($nums, $limit) {
        $n = count($nums);
        for ($i = 0; $i < $n; ++$i) {
            for ($j = $i + 1; $j < $n; ++$j) {
                if (abs($nums[$i] - $nums[$j]) <= $limit) {
                    for ($k = $j; $k > $i; $k--) {
                        if ($nums[$k] < $nums[$k - 1]) {
                            $temp = $nums[$k];
                            $nums[$k] = $nums[$k - 1];
                            $nums[$k - 1] = $temp;
                        }
                    }
                }
            }
        }
        return $nums;
    }
}
